import * as React from "react";
import { styled, useTheme } from "@mui/material/styles";
import Typography from "@mui/material/Typography";
import Box from "@mui/material/Box";
import Paper from "@mui/material/Paper";
import Grid from "@mui/material/Grid";
import Portrait from "./assets/images/portrait.jpg";
import Logo from "./assets/images/logow.png";

import { ThemeProvider } from "@mui/styles";

import { useMediaQuery } from "@mui/core";

const theme = useTheme(); //Get a copy of our default theme in our component so that we can access the breakpoints and pass the useMediaQuery

// Media query for anything under 920 px to render the hamburger
const matches = useMediaQuery(theme.breakpoints.down("sm"));

const coverStyle = {
  maxWidth: "100%",
  height: "1080px",
  backgroundImage: `url(${Portrait})`,
  backgroundSize: "cover",
  position: "center",
};
export default function Home() {
  return (
    <>
      <div className="center" style={coverStyle}>
        <Typography
          style={{
            textAlign: "center",
            position: "absolute",
            left: "50%",
            top: "65%",
            transform: "translate(-50%, -50%)",
          }}
          color="white"
          component="div"
        >
          <img src={Logo} alt="profile pic" height="100px" width="100px" />
          <br />
          <br />
          <Typography variant="h6">Connor Created</Typography>
          <br />
          <Typography variant="h5">COMING SOON</Typography>
        </Typography>
      </div>
    </>
  );
}
